func minimumSum(nums []int) int {
    minSum := -1
    for j := 1; j < len(nums)-1; j++ {
        minLeft := -1
        minRight := -1
        // Find the minimum value to the left of j that is less than nums[j]
        for i := 0; i < j; i++ {
            if nums[i] < nums[j] {
                if minLeft == -1 || nums[i] + nums[j] < minLeft + nums[j] {
                    minLeft = nums[i]
                }
            }
        }
        // Find the minimum value to the right of j that is less than nums[j]
        for k := j + 1; k < len(nums); k++ {
            if nums[k] < nums[j] {
                if minRight == -1 || nums[k] + nums[j] < minRight + nums[j] {
                    minRight = nums[k]
                }
            }
        }
        // If both sides are valid, update the minimum sum
        if minLeft != -1 && minRight != -1 {
            sum := minLeft + nums[j] + minRight
            if minSum == -1 || sum < minSum {
                minSum = sum
            }
        }
    }
    return minSum
}
